MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "");
MGCAddSnippet(5, "CalibrexRC is a parasitic extraction tool that calculates parasitic resistance and capacitance in an IC layout, and generates parasitic netlists and reports.");
MGCAddSnippet(6, "Calibre xRC is a parasitic extraction tool that generates parasitic netlists and reports. It calculates parasitic resistance and capacitance in an IC layout and outputs a simulatable netlist. In conjunction with the Calibre xL product, it can also calculate parasitic inductance.");
MGCAddSnippet(7, "Run parasitic extraction after your layout passes LVS. Calibre xRC makes use of connectivity data. If the layout is not electrically correct, the parasitic results will not apply to the final design either. ");
MGCAddSnippet(8, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(9, "The Calibre xRC tool can be run from Calibre s Graphical User Interface (GUI) tool known as Calibre Interactive.");
MGCAddSnippet(10, "The way in which you start Calibre Interactive depends on your tool environment.");
MGCAddSnippet(11, "After you invoke Calibre Interactive PEX, you are prompted to specify a runset. A runset sets default values and can be useful for managing different types of extractions. ");
MGCAddSnippet(12, "This section describes the procedure used to specify a rule file for a PEX run.");
MGCAddSnippet(13, "The source of your layout data varies depending on how you invoked Calibre Interactive and the type of extraction you plan to run.");
MGCAddSnippet(14, "This section describes the procedure used to specify the design database and format on the Layout tab.");
MGCAddSnippet(15, "Follow this procedure when you want to use source names instead of layout names in the extracted netlist.");
MGCAddSnippet(16, "Follow this procedure to specify cell lists when performing hierarchical extraction. ");
MGCAddSnippet(17, "Use the Outputs pane to specify the type of extraction.");
MGCAddSnippet(18, "Use this procedure to specify extraction mode and extraction type.");
MGCAddSnippet(19, "Use this procedure to specify the netlist type you want to produce.");
MGCAddSnippet(20, "Use this procedure to restrict the extraction to only some nets. You can either exclude nets or use only the nets you specify. To decrease netlist size, it is useful to exclude power and ground nets unless they are central to the type of analysis you have planned.");
MGCAddSnippet(21, "Use this procedure to set up LVS and xRC reports. There are five reports available. ");
MGCAddSnippet(22, "Use this procedure to add information types to the SVDB.");
MGCAddSnippet(23, "After you have selected a runfile, and the inputs and outputs for your run, click the Run PEX button. ");
MGCAddSnippet(24, "You can override Calibre PEX defaults and customize the extracted parasitic netlist by selecting appropriate options which you access via the PEX Options panel. ");
MGCAddSnippet(25, "There are three steps in the overall Calibre xRC extraction flow. Each step has many possible customizations based on your particular needs. ");
MGCAddSnippet(26, "Running Calibre xRC extraction from the command line requires that certain conditions be met.");
MGCAddSnippet(27, "The Persistent Hierarchical Database, usually referred to as the PHDB, contains information about your design s layout, connectivity, and devices necessary for calculating the parasitic information. You can create the PHDB with CalibrenmLVS‑H or Calibre xRC.");
MGCAddSnippet(28, "Once you have created the PHDB, you create the PDB. The PDB stores the parasitic models for each extracted net. ");
MGCAddSnippet(29, "As the last step, you produce a netlist or report using the Calibre xRC formatter. The netlist can be in any of several formats such as HSPICE or DSPF. You can also set the formatter to perform different types of reductions to produce netlists that are more easily simulated.");
MGCAddSnippet(30, "The Calibre xRC extraction engine is able to extract interconnect parasitics hierarchically. Hierarchical extraction is usually faster and requires less memory; the hierarchical netlists it creates are also smaller than equivalent non-hierarchical netlists and easier to simulate. This chapter provides additional information on each of the types of extraction and reviews their trade-offs.");
MGCAddSnippet(31, "A design can be extracted in several different ways. Which one is right for you depends on your design stage and what you intend to do with the netlist. ");
MGCAddSnippet(32, "The example design is a simple SRAM memory block which uses design hierarchy. The layout shows some of the block-level routing and major sub-circuits in the design, representing a simple design and how routing interacts with the different sub-circuits. ");
MGCAddSnippet(33, "Hybrid xACT 3D/Rule-Based extraction (-3d -hybrid) extracts all nets selected for Calibre xRC and a subset of nets defined for Calibre xACT 3D, and combines the results into a single parasitic database. Use this flow for high-accuracy extraction of critical nets in a full-chip sign-off process.");
MGCAddSnippet(34, "Hierarchical memory extraction (-xcell -full) extracts data for each user-defined cell as well as the top level of the design. You can nest any number of cells making it ideal for memory arrays. Each cell is extracted only once, which shortens extraction time and netlist size. ");
MGCAddSnippet(35, "Mixed-signal hierarchical extraction generates a parasitic netlist for mixed-signal designs. ");
MGCAddSnippet(36, "In-context extraction (‑xcell ‑incontext or ‑xcell ‑full) extracts a cell s parasitic information with reference to structures outside the cell boundary. The location or  context  of a cell will affect the internal parasitics of that cell. In other words, the metal interconnect in the region outside of the cell will affect the capacitances internal to the cell. ");
MGCAddSnippet(37, "Gate-level extraction (‑xcell) extracts global nets down to top-level cells (logic gates or blocks), which you specify using an xcell list. ");
MGCAddSnippet(38, "Transistor-level extraction flattens the design s interconnect nets into a top-level cell. These designs are typically less than 500,000 transistors and, subsequently, produce either lumped or distributed net models suitable for resistance and capacitance net models. The Calibre xRC tool creates net models for your design in the form of netlists and models parasitic capacitance and resistance you use for input to analysis tools.");
MGCAddSnippet(39, "The Calibre xRC tool produces the parasitic model types: Lumped Capacitance, Distributed Resistance, Distributed Resistance and Capacitance, Distributed Resistance and Coupled Capacitance.");
MGCAddSnippet(40, "There are several sources of parasitic effects in a design. ");
MGCAddSnippet(41, "Parasitic models are generally divided into two main types: lumped and distributed. ");
MGCAddSnippet(42, "With lumped capacitance extraction, all capacitance for a net is modeled as one parasitic capacitor between the net and substrate. Depending on the command line options, the parasitic capacitor may include the effects of coupled capacitance to another net with the effect lumped to ground. Resistance is not modeled. ");
MGCAddSnippet(43, "With distributed resistance extraction, the parasitic resistance of the net is broken into segments representing geometric regions. Capacitance is not modeled. ");
MGCAddSnippet(44, "With distributed resistance and capacitance extraction, the parasitic resistance of the net is broken into segments representing geometric regions. The parasitic capacitance is likewise divided into  local  segments going to the substrate, including the effect of coupled capacitance. ");
MGCAddSnippet(45, "With distributed resistance and coupled capacitance, the parasitic resistance of the net is divided into segments; however, parasitic capacitance is modeled with separate elements for coupled capacitance and intrinsic capacitance (capacitance to substrate). ");
MGCAddSnippet(46, "This chapter provides procedures for common extraction runs using both the command-line interface and the Calibre Interactive GUI. Each procedure details the minimum required steps. ");
MGCAddSnippet(47, "Running Calibre xRC extraction requires that certain conditions be met. These include:");
MGCAddSnippet(48, "In Transistor-level extraction devices and nets are examined without regards to cell boundaries. It is the most accurate form of standard xRC extraction, but also the most resource intensive.");
MGCAddSnippet(49, "Transistor-level netlists do not have any specific required SVRF statements or environment variables. They also do not require hcell or xcell files.");
MGCAddSnippet(50, "This procedure specifies the settings particular to running transistor-level extraction from Calibre Interactive.");
MGCAddSnippet(51, "The  gates  in gate-level extraction refer to logic gates. These and other predefined circuits are listed in the xcell file. Cells listed in the xcell file appear in the netlist as subcircuit instances. ");
MGCAddSnippet(52, "This procedure specifies the settings particular to running transistor-level extraction from the command line.");
MGCAddSnippet(53, "This procedure specifies the settings particular to running gate-level extraction from Calibre Interactive.");
MGCAddSnippet(54, "The difference between full hierarchical extraction and mixed-signal hierarchical extraction is whether or not all xcells are extracted in full and independent of the layout. The xcell file specifies whether each cell is a  regular  cell (no flag or a -c) to be extracted in full or a primitive cell (-p) and not extracted. The invocation and SVRF file are identical.");
MGCAddSnippet(55, "This procedure describes how to create a hierarchical netlist from the command line.");
MGCAddSnippet(56, "This procedure assumes you have an SVRF file set up for your type of parasitic extraction and only specifies the settings particular to producing hierarchical netlists.");
MGCAddSnippet(57, "ADMS extraction has been optimized for running with Calibre Interactive to produce netlists that easily work with Siemens EDA ADVance MS simulator. ");
MGCAddSnippet(58, "This procedure assumes you know how to run the Calibre Interactive GUI. ");
MGCAddSnippet(59, "Distributed RC extraction is useful when the ultimate goal is to analyze circuit loading or timing analysis. This example happens to show transistor-level extraction, but distributed RC and PrimeTime netlist format also work with gate-level and hierarchical extraction.");
MGCAddSnippet(60, "Use this procedure to create a PrimeTime netlist from the command line. ");
MGCAddSnippet(61, "This procedure specifies the settings particular to creating a PrimeTime netlist from Calibre Interactive.");
MGCAddSnippet(62, "Lumped capacitance is often the first step in characterizing a circuit. It is also easier to work with for backannotating schematics. This example happens to show transistor-level extraction, but lumped capacitance is available in all the extraction types.");
MGCAddSnippet(63, "Use this procedure to create a capacitance netlist from the command line. ");
MGCAddSnippet(64, "This procedure only specifies the settings particular to creating a lumped-C Spectre netlist.");
MGCAddSnippet(65, "Simulations run faster when netlists are simpler and have fewer elements. You can improve your simulation time by extracting only the parasitics you need for the analysis: for example, extracting capacitance throughout but resistance only for time-critical nets. To do this, run the PDB stage multiple times using ‑select as shown below. This is known as iterative extraction.");
MGCAddSnippet(66, "This procedure shows transistor-level extraction, but you could also use it with gate-level or full hierarchical extraction. The extraction level must stay the same throughout.");
MGCAddSnippet(67, "To mix parasitics in Calibre Interactive, you need to use some of the advanced options.");
MGCAddSnippet(68, "To validate Calibre xRC output you might create a netlist showing only the intentional devices. This can be done with or without the usual parasitic extraction step. The rule file still contains rules for parasitic extraction. ");
MGCAddSnippet(69, "Netlists without parasitics can be created for any of the flows. The only required difference is in the formatter step, where ‑simple replaces the typical ‑all or ‑c.");
MGCAddSnippet(70, "This procedure assumes you have a working SVRF file and only specifies the settings particular to producing non-parasitic netlists.");
MGCAddSnippet(71, "To add layout parasitics to a source netlist, you must use the source-based flow. This calculates parasitic effects based on the layout, matches the layout devices to source devices, and attempts to map parasitics. If your source and layout are not close matches (for example, 2 source resistors are laid out as 24) you will get nodes labeled as  _noxref .");
MGCAddSnippet(72, "This procedure describes how to back annotate parasitics from the command line.");
MGCAddSnippet(73, "The procedure described here is not specific to any layout viewer. There may be changes for your specific layout viewer or simulation flow.");
MGCAddSnippet(74, "The capacitance summary report lists total capacitance and the ratio of coupling capacitance for all nets. It is controlled solely by the SVRF statement, PEX Report Netsummary. If the statement is present in the SVRF file, a run will produce the capacitance summary report regardless of other settings.");
MGCAddSnippet(75, "The coupling capacitance report shows the amount of capacitance between specific pairs of nets and calculates how much this coupling capacitance represents of the total coupling on each net.");
MGCAddSnippet(76, "Use this procedure to report coupled capacitance to a file from the command line.");
MGCAddSnippet(77, "This procedure includes only the minimum steps to generate the report. It can be created for any run that includes CC parasitics.");
MGCAddSnippet(78, "Point-to-point resistance reports report on resistance along a single layout net. The points can be anywhere along the net. The point-to-point calculations take temperature effect into consideration when generating the report or looking at values in Calibre RVE. The Calibre Interactive interface allows you to turn the report on or off, but the contents of the report are controlled through a separate text file.");
MGCAddSnippet(79, "This procedure describes the steps necessary to generate a net resistance report from the command line.");
MGCAddSnippet(80, "This procedure includes only the minimum steps to generate the report. It can be created for any run that includes parasitic resistance.");
MGCAddSnippet(81, "To extract individual cells, run in-context extraction. Only the specified cell instances are extracted, and not the top-level design. ");
MGCAddSnippet(82, "To extract only top-level interconnect, place all cells instantiated in the top level in the xcell file. Use the cell names without IDs. Then run extraction using gate-level extraction. This occurs automatically with LEF/DEF layouts.");
MGCAddSnippet(83, "The CalibrexRCCB tool performs parasitic extraction on designs containing up to 100,000 transistors depending on design complexity and computer memory. ");
MGCAddSnippet(84, "This procedure describes how to run Calibre xRC CB from the command line. ");
MGCAddSnippet(85, "This procedure assumes you have a working SVRF file and includes only the minimum steps to use the CB license. ");
MGCAddSnippet(86, "Basic extraction processes can be modified to handle different types of input.");
MGCAddSnippet(87, "When performing hierarchical extraction, you define your design s hierarchy for Calibre xRC by identifying the lower-level cells in the design hierarchy.");
MGCAddSnippet(88, "When performing source name extraction, you must provide Calibre nmLVS‑H with an hcell list that includes the cells you will use as xcells with Calibre xRC. ");
MGCAddSnippet(89, "An xcell list can have either of two formats, hcell or xcell. ");
MGCAddSnippet(90, "This procedure describes how to specify a valid layout path or  parent_id/cell_id  for -C cells in the xcell file.");
MGCAddSnippet(91, "You can use an asterisk (*) as a wildcard in the xcell list to ease the task of creating an xcell file. ");
MGCAddSnippet(92, "For most GDS-based extractions, you can shorten extraction time by using only a subset of the LVS hcells as xRC xcells. The cells you specify affect performance and accuracy.");
MGCAddSnippet(93, "By default, the Calibre xRC tool treats floating signal nets as fixed (grounded) and does not extract them. However, floating nets are not ignored when calculating the capacitance of non-floating nets.");
MGCAddSnippet(94, "Use this procedure when you need to reflect multiple ground regions of a design in your simulation, for example, when performing substrate noise analysis. ");
MGCAddSnippet(95, "If you have chemical mechanical polishing (CMP) models, such as CMPA, VCMP, or the database produced by Praesagus  Copper Prediction and Verification software, you can use its calculations for conductor thickness. The CMP data overrides all other methods of calculating thickness, such as PEX Thickness EQN or PEX Table. The Calibre xRC interpreter converts thickness values into the same units used by the extraction.");
MGCAddSnippet(96, "The basic extraction flow can be modified to refine the extracted information.");
MGCAddSnippet(97, "Calibre xRC supports extraction of devices that do not contain parasitics in the xcells. This is useful for flows where the device models already include the parasitics. For example, when physical layout of devices is done by using device generators or parameterized cells (pcells), and the device models are parameterized to match the layout.");
MGCAddSnippet(98, "Use the following procedure to perform selected-net extraction with the Calibre xRC tool.");
MGCAddSnippet(99, "You can use wildcards to include or exclude nets when performing a parasitic extraction run. You can also specify where in the hierarchy to search for a matching net name.");
MGCAddSnippet(100, "Excluding power and ground nets from extraction helps reduce runtime and parasitic netlist size.");
MGCAddSnippet(101, "You can force decoupling of coupled capacitors with the Calibre xRC formatter using the optional  ‑g  switch when you invoke the Calibre xRC formatter. ");
MGCAddSnippet(102, "By default, floating nets are treated as grounded during extraction. A floating net is defined as one not connected to a device and lacking port text. (The shapes comprising the floating net may have text attached in other ways such as by Attach without Port Layer Text. Because this does not define port placement, connectivity is not defined and the net remains floating.)");
MGCAddSnippet(103, "In applications that integrate front-end RF devices in conventional CMOS technologies, the existence of high resistivity (low mobility) and low resistivity substrate areas within the same wafer is very common. Use this procedure to extract parasitics in the presence of multiple substrates. ");
MGCAddSnippet(104, "You can set up a rule file for parasitic resistance extraction so that it can be used with Calibre PERC. ");
MGCAddSnippet(105, "The basic extraction procedures can be customized in many ways to generate different types of netlist output. ");
MGCAddSnippet(106, "Follow this procedure when you want to netlist multiple user-defined corners in a single run. Process corners refer to the variations on a  typical  process; for instance, metal thickness may not be exactly controlled. Use this procedure for both foundry-supplied corners defined in a PEX Corner statement and variations on foundry-supplied corners that you define.");
MGCAddSnippet(107, "To output a net, its devices, and the extracted parasitics without additional nets or devices, use the PRUNE keyword as part of the SVRF statement PEX Netlist and perform selected-net extraction. ");
MGCAddSnippet(108, "When performing parasitic extraction with the Calibre xRC tool, you can encounter issues with logical pin swapping in a distributed RC parasitic netlist.");
MGCAddSnippet(109, "Normally, the Calibre xRC formatter produces a layout netlist containing source names. The formatter uses the circuit pin order and cell hierarchy in the source netlist instead of the layout netlist when generating the extracted netlist. ");
MGCAddSnippet(110, "Distributed parasitic extraction with Calibre xRC does not automatically connect multiple disjoint fragments of parasitic net models.");
MGCAddSnippet(111, "The Calibre xRC formatter uses the name of a connected port for the name of a net, even if the name of the port is different from the net name in the parasitic model. This is the standard behavior for Calibre xRC.");
MGCAddSnippet(112, "Within the parasitic model, a probe point exists as an internal connection with a unique probe_name. You can access each probe point by net and probe_name, depending on your simulator s behavior.");
MGCAddSnippet(113, "Layout properties are calculated and represented in the Calibre View netlist produced by Calibre xRC.");
MGCAddSnippet(114, "This chapter contains information on tool integration and troubleshooting.");
MGCAddSnippet(115, "The goal of this section is to provide information for CAD engineers who are deploying pre-configured tools to their engineering groups. ");
MGCAddSnippet(116, "The Calibre Interactive environment reads several types of configuration files. Settings in any of these affect how Calibre runs initiated from Calibre Interactive behave. ");
MGCAddSnippet(117, "Many CAD engineers find it easiest to create new scripts by working in Calibre Interactive until they have a debugged set up, and then using Calibre Interactive s files as the basis of a shell script which they deliver to their customers. ");
MGCAddSnippet(118, "This section contains an example run script and tips for writing shell scripts. The tips are based on experience helping customers set up their solutions.");
MGCAddSnippet(119, "The goal of this section is to provide tips for common optimization problems that CAD engineers are asked to tackle. Optimization is a broad topic, and these suggestions are by no means exhaustive.");
MGCAddSnippet(120, "There are several methods to make Calibre xRC runs shorter. ");
MGCAddSnippet(121, "There are two ways to create smaller netlists:");
MGCAddSnippet(122, "You can use Calibre to check whether layouts are suitable for process migration. Scaling designs and running DRC is relatively straightforward, but smaller sizes also require you to recalculate parasitic effects. (Note that below 90 nm, calibrated capacitance and resistance rule files older than v2008.1 are not recommended.) ");
MGCAddSnippet(123, "The goal of this section is to provide CAD engineers with some simple heuristics to aid in-house troubleshooting. It includes many of the steps used by Siemens support representative for initially diagnosing problems. ");
MGCAddSnippet(124, "Follow these steps when you get a call from a user who is having trouble. ");
MGCAddSnippet(125, "If you are getting a usage message when you try to invoke Calibre, there is an error in the command line. ");
MGCAddSnippet(126, "Calibre xRC provides parasitic extraction techniques for on-chip variation analysis.");
MGCAddSnippet(127, "On-chip variation refers to the inter- and intra-die variation in physical process properties. These variations can cause poor yields.");
MGCAddSnippet(128, "The parasitic extraction techniques for on-chip variation are independent of each other and may be singly or jointly used in extraction. ");
MGCAddSnippet(129, "In-die variation is generally enabled by the foundry. The Calibre xRC user can turn it on or off, but not change its values. ");
MGCAddSnippet(130, "Process corners can be created by both the foundry and the chip development team. When Calibre xRC extracts parasitics, a process corner and all user-defined corners are extracted at once. You can choose to netlist all corners, or just a few.");
MGCAddSnippet(131, "Most manufacturing processes use chemical-mechanical polishing (CMP) to planarize the wafer surface after deposition. The effect of the CMP step is calculated using complex software which creates data files. The foundry may supply those files as part of a design kit.");
MGCAddSnippet(132, "Calibre xRC command line options allow you to perform extraction from the command line or with a run script.");
MGCAddSnippet(133, "The invocation descriptions use font properties and several meta-characters to document the command syntax.");
MGCAddSnippet(134, "Calibre tools require that the CALIBRE_HOME environment variable be set. ");
MGCAddSnippet(135, "Reference pages describe the command line invocation syntax for the Calibre xRC tool. ");
MGCAddSnippet(136, "Runs the Calibre nmLVS‑H tool and creates the Persistent Hierarchical Database (PHDB) for use by the Calibre xRC tool.");
MGCAddSnippet(137, "Performs connectivity extraction and device recognition, and writes the results to a PHDB. ");
MGCAddSnippet(138, "Extracts parasitic data and performs parasitic analysis on the data within the PHDB. It also generates the Parasitic Databases (PDBs) containing the electrical data for each net.");
MGCAddSnippet(139, "Produces netlists and reports from the PDB contents. ");
MGCAddSnippet(140, "The information in the following sections focuses on the Calibre xRC parasitic extraction tool and the xCalibrate rule file generator.");
MGCAddSnippet(141, "Capacitance exists anytime you have two conducting layers in close proximity separated by a dielectric, such as interconnect or floating nets. When this capacitance is not part of a design, it is parasitic capacitance.");
MGCAddSnippet(142, "xCalibrate uses several models for calculations; xRC combines the xCalibrate models into coupled capacitance and intrinsic capacitance. In the netlist, these can be output separately or with coupled capacitance grounded, referred to as  lumped  capacitance.");
MGCAddSnippet(143, "Parasitic resistance is an inherent property of any material. Conductors have very low resistance to current flow, but are not perfect. The unwanted resistance is calculated post-layout by parasitic extraction and then included in simulation because the parasitic resistance of interconnect can decrease signal amplitude and increase rise time. In power lines, parasitic resistance can also cause DC voltage drop.");
MGCAddSnippet(144, "The xCalibrate rule file generator produces rules for resistance calculations. The rules incorporate factors for multiple process corners and in-die variation. They provide the information needed by the Calibre xRC resistance engine, which recognizes shapes and applies different resistance calculations for each.");
MGCAddSnippet(145, "Parasitic extraction has several specialized SVRF statements and controls.");
MGCAddSnippet(146, "Guidelines to remember when working with SVRF rule files.");
MGCAddSnippet(147, "To create a PHDB, your rule file must have the following types of rules:");
MGCAddSnippet(148, "When creating lumped capacitance netlists, your SVRF rules specify the following:");
MGCAddSnippet(149, "Certain statements are required for distributed RC extraction. ");
MGCAddSnippet(150, "There are three additional commands: one to model in-die variation and two netlist reduction commands.");
MGCAddSnippet(151, "The following SVRF statements are required for source-name extraction:");
MGCAddSnippet(152, "The following example SVRF rule file is a working example for connectivity extraction for Calibre nmLVS. It represents the minimum required functionality before adding Calibre xRC required statements.");
MGCAddSnippet(153, "Calibre xRC generates various forms of extraction data and output.");
MGCAddSnippet(154, "Calibre xRC uses databases to store design and extraction data at different stages of the extraction process. ");
MGCAddSnippet(155, "Each PDB contains the results of parasitic extraction and analysis on a specified primary layout cell and the data for the design s total nets. The Calibre xRC formatter generates netlists and reports from the data a PDB contains.");
MGCAddSnippet(156, "A PHDB can be created with either Calibre nmLVS or Calibre xRC software. Although you can use either LVS or LVS‑H (hierarchical LVS), all parasitic extraction except transistor level requires a hierarchical database; that is, you cannot use non-hierarchical Calibre nmLVS except for transistor-level extraction.");
MGCAddSnippet(157, "The Standard Verification Database (SVDB) is a central repository for data files and directories the Calibre nmLVS‑H and Calibre xRC tools create, specifically the PHDB and PDB. Additionally, the SVDB stores the cross-reference files the Calibre nmLVS‑H tool creates and the Calibre xRC formatter uses when you use source name extraction.");
MGCAddSnippet(158, "Logfiles generated during extraction contain valuable processing and results information.");
MGCAddSnippet(159, "The Calibre xRC tool outputs different files depending on the netlist format (for example, HSPICE) you specified. Normally, these files are in your current working directory.");
MGCAddSnippet(160, "The Calibre xRC formatter normally creates the ASCII report in your current working directory.");
MGCAddSnippet(161, "Templates are ASCII text files used for defining pin direction and order in the output netlist. They are created by the formatter in the SVDB directory, and can be edited in a text editor. (Older versions of the Calibre xRC tool wrote templates in the current working directory and the formatter checks that location first.)");
MGCAddSnippet(162, "Calibre xRC provides reduction controls used to reduce run time and/or netlist size.");
MGCAddSnippet(163, "Use reduction to control the number of capacitors and resistors that are output by extraction.");
MGCAddSnippet(164, "Threshold-based reduction allows you to control the parasitic reduction output.");
MGCAddSnippet(165, "TICER stands for  Time Constant Equilibration Reduction . You specify this reduction method in your SVRF rule file using the following SVRF statement and keyword:");
MGCAddSnippet(166, "The Time-it tool is a path-trace delay calculator, and computes both interconnect and cell delay data for a netlist. ");
MGCAddSnippet(167, "The Time-it tool is a path-trace delay calculator, and computes both interconnect and cell delay data for a netlist. ");
MGCAddSnippet(168, "The Time-it tool is a high-capacity, path-trace delay calculator for deep submicron process cell-based designs. ");
MGCAddSnippet(169, "Error and warning messages are generated by the Calibre xRC tool at run time. ");
MGCAddSnippet(170, "Error messages must be corrected to continue a Calibre xRC run. ");
MGCAddSnippet(171, "Warning messages should be reviewed to determine if they indicate a real problem in your design.");
MGCAddSnippet(172, "");
MGCAddSnippet(173, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

